import '../C_dashboard/style_dashboard.css';
import RMSlogo from '../C_dashboard/RMSlogo.js';
import React from 'react';
import icon_feed from '../C_dashboard/icons/icon_feed.png';
import icon_search from '../C_dashboard/icons/icon_search.png';
import icon_upload from '../C_dashboard/icons/icon_upload.png';
import icon_notifications from '../C_dashboard/icons/icon_notifications.png';


function NavBar(props) {
  
  return (    
    <div class="menubar">      
      <div class="menuleft">
        <div class="rms_fullname"><RMSlogo/></div>
      </div>
      <div class="menuright">
        <div class="menuoption" id="feed">
          <img src={icon_feed} className="menuicon" alt="icon" />
          Feed
        </div>
        <div class="menuoption" id="search">
          <img src={icon_search} className="menuicon" alt="icon" />
          Search
        </div>
        <div class="menuoption" id="upload">
          <img src={icon_upload} className="menuicon" alt="icon" />
          Upload
        </div>
        <div class="menuoption" id="notifications">
          <img src={icon_notifications} className="menuicon" alt="icon" />
          Notifications
        </div>

        {(() => {
          switch (props.menubar_option) {

            case "feed":
              var selected_element = document.getElementById("feed");
              selected_element.classList.add("active_option");
              break;

            case "search":
                var selected_element = document.getElementById("search");
                selected_element.classList.add("active_option");
                break;
            
            case "upload":
              var selected_element = document.getElementById("upload");
              selected_element.classList.add("active_option");
              break;

            case "notifications":
              var selected_element = document.getElementById("notifications");
              selected_element.classList.add("active_option");
              break;
                
              default:
              return <h1>Rendered navbar option: none</h1>;
          }
        })()}
        

      </div>
      
      
    </div>  
  );
}

export default NavBar;
